import Axios from 'axios';

export const createDoctors = async (doctors) => {
  const queryDocs = doctors.map(async (doctor) => {
    let res = await Axios.get(
      `http://localhost:3000/geocodes/details/${doctor.place_id}`
    );
    const detailedDoctor = res.data.result;
    console.log(detailedDoctor)
    const {
      formatted_address,
      formatted_phone_number,
      name,
      place_id,
      rating,
      url,
      website,
      user_ratings_total,
      geometry: {
        location: { lat, lng },
      },
    } = detailedDoctor;

    const doctorHash = {
      place_id,
      name,
      formatted_address,
      rating,
      user_ratings_total,
      formatted_phone_number,
      lat,
      lng,
      url,
      website,
    };

    // debugger;
    const myHeaders = new Headers();
    myHeaders.append('Content-Type', 'Application/json');
    myHeaders.append('accepts', 'application/json');
    const requestOptions = {
      method: 'POST',
      headers: myHeaders,
      body: JSON.stringify(doctorHash),
      redirect: 'follow',
    };
    try {
      const docdoc = await Axios('http://localhost:3000/doctors',requestOptions      );

    } catch (err) {
      console.log('ERROR', err);
    }
  });
  console.log(queryDocs);
  return queryDocs;
};
